import React from "react";
import dummyData from "../dummy-data";

const List = props =>{ 
    return(
        <div>   
        {
            props.searchData.map((item,index) => {
                return <li key={index}>{item.title}</li> 
                 
            })
        }
            <button>Edit</button>
            <button>Delete</button>
        </div>
    );
};
export default List;
